import './App.css';

function App() {
  return (
    <div className="App">
      <p>Hello World!</p>
      <form onSubmit={this.handleSubmit}>
        <input type="file" accept="video/*" id="upload" />
        <button>Start</button>
      </form>
    </div>
  );
}

export default App;
